const CustomerCard = ({ data }) => {
    return (
      <table>
          <thead>
        <tr>
            <th>Name</th>
            <th>Address</th>
            <th>City</th>
            <th>Country</th>
        </tr>
        </thead>
   <tbody>
             <tr>
             <td>{data.name}</td>
             <td>{data.address}</td>
             <td>{data.city}</td>
             <td>{data.country}</td>
             </tr> 

         </tbody>  
         </table>      
          
    );
  };
  
  export default CustomerCard;
